import { Video } from '../../../../data/api/videoApi';
import { MoviesContainer, MoviesPoster, MoviesRow, MoviesTitle } from './Movies.styles';

interface MoviesProps {
  title: string;
  movies: any;
}

export default function Movies({ title, movies }: MoviesProps) {
  return (
    <MoviesContainer>
      <MoviesTitle>{title}</MoviesTitle>
      <MoviesRow>
        {movies.map((video: Video) => (
          <MoviesPoster key={video.id} src={'https://image.tmdb.org/t/p/w300' + movies.poster_path} />
        ))}
      </MoviesRow>
    </MoviesContainer>
  );
}
